(function(current, scratchpad) {
	var gr = (new x_44813_usasoc_cst.TaskHelper(this._req_item)).getDefaultApprovalGroupByCallerLocation();
	if (gs.nil(gr)) {
		gs.warn('Failed to get location-based approval group for ' + current.sys_id);
		gr = (new x_44813_usasoc_cst.USASOCCustomizations()).getDefaultScCatItemApprovalGroup();
		if (gs.nil(gr))
			gs.error('Failed to get fallback service catalog approval group');
		else
			scratchpad.approval_group = '' + gr.sys_id;
	}
})(current, workflow.scratchpad());

